B.FZ=new A.uD("Dear Reader,\nI have a big interest in Mobile Developer positions. I have a Technical degree in informatics and experience working as a Developer for Banking core and E-commerce companies in different countries, which gave me proficiency in mobile features and TypeScript. My education and experience are a great fit for what you need from a Mobile Developer.\nMy professional experience includes designing and crafting code for various mobile applications and then testing the resulting code to meet client needs. I also have experience working in a collaborative environment and presenting status updates to project stakeholders.\nHere are some highlights of my qualifications and professional achievements in mobile application design:\nDesigned and developed an Android and iOS application to banking core called ITU CHILE (Banco Ita\xfa Unibanco S.A) using React Native, Typescript, Redux thunk, and applying Atom Design, with REST API backend in AWS.\nResponsible for developing and maintaining iOS and Android applications for Globant, a Software development company.\nWrote test cases for all new features, in 90% of coverage, and added and performed multiple rounds of regression testing to maintain the quality of the products\nFor Platanitos E-commerce in Peru, I completed rebuilding the Android and iOS application, refined and developed features resulting decrease in crashes to 1%, an increase in user retention by 300%, generating more than 1M users in 3 months, and increasing sales of products.\nAs a personal project, designed and developed an Android Taxi App called Pickpointer, which was successfully deployed in the Google App Store and shows interesting data like available or locked routes for natural disasters or events.\nMy passion for designing useful and appealing mobile application software is what drives me to pursue a career at your company, and my eye for design and user-driven approach to development make me an ideal candidate. If you think I\u2019d be a good fit for the position, then please reach out to set up an interview at your earliest convenience.\nSincerely, Binni Cordova",null)
